    "            for k in range(j+1,3):\n",
    "               #if (j!=k) and (j<k):\n",
    "                tp=v[j]-v[k]\n",
    "                d=np.sqrt(abs(np.dot(np.dot(tp,invD),tp.T)))\n",
    "                a.append(d)\n",
    "            \n",
    "        print(i,a)\n",
    "        tensor.append(a)\n",
    "    except:\n",
    "        print(\"不可逆\")\n",
