    "tensor =[]\n",
    "for i in range(0,512):\n",
    "   \n",
    "    u=model_6.get_layer('conv2d_9').get_weights()[0][:,:,:,i].squeeze()\n",
    "    v=np.mean(u, axis=1)\n",
    "    #print(v)\n",
    "    vT=v.T\n",
    "    D=np.cov(vT)\n",
    "    try:                 \n",
    "        invD=np.linalg.inv(D)\n",
    "        #t=np.mean(v,axis=1)\n",
    "        a=[]\n",
    "\n",
    "        for j in range(0,2): #表示filter的大小\n",
    "            for k in range(j+1,3):\n",
    "               #if (j!=k) and (j<k):\n",
    "                tp=v[j]-v[k]\n",
    "                d=np.sqrt(abs(np.dot(np.dot(tp,invD),tp.T)))\n",
    "                a.append(d)\n",
    "            \n",
    "        print(i,a)\n",
    "        tensor.append(a)\n",
    "    except:\n",
    "        print(\"不可逆\")\n",
    "print(tensor)"
